Carrot Onion Fritters Recipe:
Ingredients;
4 Large Carrots, shredded in food processor using slicing disk 2 Medium Onions, peeled & diced Small Handful of Flour (1/3 cup) 1 Tbsp Olive oil, divided 2 Eggs Whisked Salt & Pepper to taste 3 Cups of Breadcrumbs Pinch Cayenne Optional Parmesan cheese
Instructions are as follows;

Preheat deep fat fryer or pan with oil up to 350Â°F / 180Â°C  Add egg and flour mix into large bowl, beat well.   Mix in the seasonings to taste.   Then add in vegetables, stir through until all coated   Coat each ball in bread crumbs thoroughly  Fry for approx. 4-6 minutes at 350 Â°F / 175 Â°C, turn halfway through cooking time till nice and golden brown. Drain onto paper towels  Serve hot Enjoy!     Note; The number of servings depends greatly on how much filling you put inside, one medium size zucchini per person may be sufficient. Also if deep fried they're good served with mayonnaise or chutney :) I hope this helps please let me know what you think ! If not can you give me more detail regarding your questions ? Thank You  :D

